svg.script:
function clickOn(layerIndex) {
  turnOn(layerIndex);
  updateOutput();
}

function clickOff(layerIndex) {
  turnOff(layerIndex);
  updateOutput();
}


function turnOn(layerIndex) {
  document.getElementById(layerIndex).style.display = 'block';
}

function turnOff(layerIndex) {
  document.getElementById(layerIndex).style.display = 'none';
}

function pinLow(layerIndex)  { turnOn(layerIndex) }
function pinHigh(layerIndex) { turnOff(layerIndex) }

function getPinLevel(layerIndex) { return (document.getElementById(layerIndex).style.display === 'none'); }

function getInputs() {  
  return 0+ 
   (getPinLevel('layer1')?1:0) + 
   (getPinLevel('layer2')?2:0) + 
   (getPinLevel('layer3')?4:0) + 
   (getPinLevel('layer4')?8:0) + 
   (getPinLevel('layer5')?16:0) +
   (getPinLevel('layer6')?32:0) ; 
}

function updateOutput() {

  var index = 1;

  // G1, G2B, G2A, C, B, A
  const LTable = [ 255, 255, 255, 255, 255, 255, 255, 255, 
                             255, 255, 255, 255, 255, 255, 255, 255, 
                             255, 255, 255, 255, 255, 255, 255, 255, 
                             255, 255, 255, 255, 255, 255, 255, 255, 
                             254, 253, 251, 247, 239, 223, 191, 127, 
                             255, 255, 255, 255, 255, 255, 255, 255, 
                             255, 255, 255, 255, 255, 255, 255, 255, 
                             255, 255, 255, 255, 255, 255, 255, 255 ];

  var output = LTable[getInputs()];

  if (output & 1) pinHigh('layer14'); else pinLow('layer14');
  if (output & 2) pinHigh('layer13'); else pinLow('layer13');
  if (output & 4) pinHigh('layer12'); else pinLow('layer12');
  if (output & 8) pinHigh('layer11'); else pinLow('layer11');
  if (output & 16) pinHigh('layer10'); else pinLow('layer10');
  if (output & 32) pinHigh('layer9'); else pinLow('layer9');
  if (output & 64) pinHigh('layer8'); else pinLow('layer8');
  if (output & 128) pinHigh('layer7'); else pinLow('layer7');

}
